.NavigationBar {
    background: transparent;
    border-bottom: 1px solid var(--ctx-menu-separator);
}

.NavigationBar[data-layout="wrap"] .main-items {
    display: flex;
    justify-content: center;
    border: 1px solid red;
padding-top: 100px !important;
}

.NavigationBar[data-layout="inline"] .main-items .nav-item[data-index="-1"][data-active="true"] {
    opacity: 1;
    z-index: 100;
    transform: scale(1, 1);
}

.NavigationBar .static-btns {
    transition: opacity 0.5s linear;
}

#root:not(:hover) .NavigationBar[data-layout="inline"] .static-btns {
    opacity: 0;
    z-index: -1;
    transform: scale(0, 0);;
}

#root:not(:hover) .TabsPanel {
    --tabs-indent: 0px;
}

#root:not(:hover)[data-tabs-tree-lvl-marks="true"] .Tab[data-pin="false"]:not([data-lvl="0"]) .body:after {
    display: none;
}

.Tab .body:hover {
    background-color: rgb(231, 233, 206, 0.3) !important;
}

.Tab .close {
    margin: 0 5px;
}

.Tab .audio {
    position: absolute;
    top: unset !important;
    bottom: -2px;
    right: -2px;
    height: 16px !important;
    width: 16px !important;
    background: rgb(231, 233, 206, 0.85) im !important;
    border-radius: 100px;
    box-shadow: var(--nav-btn-active-shadow);
}

.Tab .t-box {
    --audio-btn-offset: 0;
}

#root:not(:hover) .SearchBar::before {
    background: transparent;
}

#root:not(:hover) .SearchBar .placeholder,
#root:not(:hover) .SearchBar .input {
    opacity: 0;
}

#root:not(:hover) .SearchBar .clear-btn {
    display: none;
}

#root:not(:hover) .PanelPlaceholder {
    writing-mode: vertical-rl;
    text-orientation: mixed;
}

.BottomBar .tool-btn {
    min-width: var(--tabs-pinned-width);
}

.Tab .fav {
  min-width: 28px/*var(--fav-size)*/;
  min-height: 28px/*var(--fav-size)*/;
/*  margin-left: 5px;*/
}
.Tab .fav > .fav-icon {
  min-width: var(--fav-size);
  min-height: var(--fav-size);
    /*filter: drop-shadow(0px 0px 4px rgba(220,220,220,0.3)) !important;*/
}
.Tab .fav-icon {
    display: flex !important;
    align-items: center !important;
    margin-top: 5px !important;
        margin-bottom: auto !important;
}

/*custom button badge*/
.button__badge {
  background-color: #fa3e3e;
  border-radius: 2px;
  color: white;

  padding: 1px 3px;
  font-size: 8px;

  position: absolute; /* Position the badge within the relatively positioned button */
  top: 0;
  left: 0;
}

.tab-close-button, .close-icon {
  border-radius: 500px !important;
  margin-right: 3.5px !important;
  background-color: rgb(27, 29, 28, .7) !important ;
  transition: all 0.3s;
}
.tab-close-button:hover,
.close-icon:hover {
  background-color: rgb(27, 29, 28, 0.3) !important;
  transform: rotate(180deg) !important;
  transition: transform ease-in-out .5s !important;
}
.Tab[data-active="true"] .close {
    background-color: #1b1d1c20 !important;
}
.Tab[data-active="true"] .close-icon {
        fill: #E7E9CE !important;
}
.Tab[data-active="true"] .close-icon:hover {
    background-color: #E7E9CE !important;
        fill: #1b1d1c !important;
}




.Tab:hover .fav,
.Tab:hover .t-box,
.Tab:hover .audio  {
  transform: translateX(16px);
  transition: transform .8s ease-in-out;
}
